import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a product detail modal to add to cart (simulate user flow)
    // We'll select the first product card and click it
    await page.waitForSelector('.product-card');
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) throw new Error('No product cards found');
    await productCards[0].click();

    // Wait for the product modal to appear
    await page.waitForSelector('#productModal', { state: 'visible' });
    await page.waitForSelector('#productDetail');

    // Set quantity to 3 in the product modal
    await page.waitForSelector('#quantity');
    await page.selectOption('#quantity', '3');

    // Take screenshot after selecting quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_quantity_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_quantity_selected.png'));

    // Click "Add to Cart" button in the modal
    const addToCartBtn = await page.$('#productModal .add-to-cart');
    if (!addToCartBtn) throw new Error('Add to Cart button not found in modal');
    await addToCartBtn.click();

    // Wait for notification to appear and disappear (success message)
    await page.waitForSelector('.notification.success', { timeout: 2000 });
    await page.waitForTimeout(1200); // Let notification show

    // Close the modal (simulate clicking the close button)
    const closeBtn = await page.$('#productModal .close');
    if (closeBtn) {
      await closeBtn.click();
      await page.waitForSelector('#productModal', { state: 'hidden' });
    }

    // Open the cart modal (simulate clicking the cart icon)
    // Find the cart element and click it
    await page.waitForSelector('.cart');
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { state: 'visible' });
    await page.waitForSelector('#cartItems');

    // Take screenshot of cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal.png'));

    // Find the quantity for the first cart item and update it to 5 using the "+" button
    // Wait for at least one cart-item
    await page.waitForSelector('.cart-item');
    const cartItem = (await page.$$('.cart-item'))[0];
    if (!cartItem) throw new Error('No cart item found');

    // Get current quantity
    const quantitySpan = await cartItem.$('.quantity');
    let currentQuantity = parseInt(await quantitySpan.innerText());
    // Click "+" button until quantity is 5
    const plusBtn = await cartItem.$('.quantity-btn:nth-of-type(2)');
    while (currentQuantity < 5) {
      await plusBtn.click();
      await page.waitForTimeout(200); // Wait for UI update
      currentQuantity = parseInt(await quantitySpan.innerText());
    }

    // Take screenshot after updating quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // Extract cart item data for verification
    const cartItemTitle = await cartItem.$eval('.cart-item-title', el => el.textContent.trim());
    const cartItemQuantity = await cartItem.$eval('.quantity', el => el.textContent.trim());
    const cartItemPrice = await cartItem.$eval('.cart-item-price', el => el.textContent.trim());

    // Optionally, extract cart total
    const cartTotal = await page.$eval('#cartTotal', el => el.textContent.trim());

    return {
      success: true,
      action: "Updated cart item quantity to 5 via cart modal after adding product with quantity 3 from product detail modal.",
      extractedData: {
        cartItemTitle,
        cartItemQuantity,
        cartItemPrice,
        cartTotal
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
